  render() {
    return (
      <div className="App">
        <canvas className="background">
            <img src="https://camo.githubusercontent.com/3387142119eaf19786778d22c11e7930975096c5/68747470733a2f2f63646e2e7261776769742e636f6d2f66696c652d69636f6e732f736f757263652f6d61737465722f7376672f50686f656e69782e737667" className="bird-img" alt=""/>
          <h1><strong>Phoenix vs World</strong></h1>
        </canvas>
      </div>
    );
  }
}

export default App;
